function Property({arr , name ,oldArr,details}){
let abc=true;
let a= true;
let b= true;
let c= false;

const newOne = oldArr.map((item)=>{
    return(<div>{item}</div>)
  })

  const newDetails = details.map((element)=>{
      
      return(
       <tr>
           <th>
               <td>{element.fname}</td>
               <td>{element.lname}</td>
               <td>{element.email}</td>
               <td>{element.age}</td>
               <td>{element.nationality}</td>
               <td>{element.belongsTo}</td>
               <td>{element.state}</td>
               <td>{element.city}</td>
           </th>
       </tr>
      )
      
  })
    
    
    return(<div>
    <div>{arr} {name()}</div>
    {abc && <div>hi</div>}
    {abc==true ? <div>yes</div> : <div>no</div>}

    <div>{newOne}</div>
    <table border="2">
        
        <tr>
            <td>{newDetails}</td>
        </tr>
        </table>
    


    

     
    </div>
    );
}
export default Property;
